import React from 'react';
import { FaEnvelope, FaPhone, FaMapMarkerAlt } from 'react-icons/fa';

const Contact = () => {
  const email = 'email@example.com';
  const phoneNumber = '+1 123 456 7890';
  const address = '인하대학교 하이테크센터 001';

  return (
    <div className="contact-container">
      <h2>문의하기</h2>
      <p>더 궁금한 것이 있거나 도움이 필요하신가요? 언제든지 아래의 다양한 방법으로 연락주세요. 우리는 항상 여러분을 도와드리기 위해 여기 있습니다.</p>

      <div className="contact-method">
        <FaEnvelope />
        <p>이메일: <a href={`mailto:${email}`}>email</a></p>
      </div>

      <div className="contact-method">
        <FaPhone />
        <p>전화번호: <a href={`tel:${phoneNumber}`}>{phoneNumber}</a></p>
      </div>

      <div className="contact-method">
        <FaMapMarkerAlt />
        <p>방문 주소: {address}</p>
      </div>

      <p>문의 사항이나 피드백을 기다리고 있어요. 여러분과 소통하는 것을 기대하고 있습니다!</p>
    </div>
  );
};

export default Contact;
